import React, {Component} from 'react';
import {Helmet} from 'react-helmet';
import ProjectCard from '../components/projectCard';


const title = "Projects|Alper Tunca";

class Projects extends Component {
    render() {
        const divStyle = {
            width: "100%",
            background: "#1F1E1A"
        };

        const colorStyle = {
            color: "#34A4EB"
        };

        return (
            <div style={divStyle} className="mt-3">
                <Helmet>
                    <title>{title}</title>
                </Helmet>
                <h1 style={colorStyle}>PROJECTS</h1>
                <p style={colorStyle}>My projects are here, you can open github for more</p>

                <div style={{margin : "auto"}}>
                    <ProjectCard cardHeader="Project #1" />
                    <br/>
                    <ProjectCard cardHeader="Project #2" />
                </div>

            </div>
        );
    }
}

export default Projects;
